import '../style/login.css'
import fire from '../firebase/fire'


const Login = ()=> {

    const [username, setUsername] = useState(null)
    const [password, setPassword] = useState(null)


    const HandleSubmit = () =>{

        fire.auth().createUserWithEmailAndPassword(username, password)
        .then((userCredential) => {
            // Signed in 
            var user = userCredential.user;
            // ...
        })
        .catch((error) => {
            var errorCode = error.code;
            var errorMessage = error.message;
            // ..
        });

    }

    return(
        <>
        <h1>LOGIN</h1>
        <div class="container">
            <label for="uname"><b>Username</b></label>
            <input onChange={(e)=>setUsername(e.target.value)} type="text" placeholder="Enter Username" name="uname" required/>

            <label for="psw"><b>Password</b></label>
            <input onChange={(e)=>setPassword(e.target.value)} type="password" placeholder="Enter Password" name="psw" required/>

            <button type="submit" onClick={HandleSubmit()}>Login</button>
            <label></label>
        </div>

        </>
    )
}

export default Login
